import React, { useState, useEffect } from "react";
import Papa from "papaparse";
import { Line } from "react-chartjs-2";
import "chart.js/auto";

const videoMapping = {
  0: { name: "Sit", path: "/videos/sit.mp4" },
  1: { name: "Forward Bend", path: "/videos/forward_bend.mp4" },
  2: { name: "Warrior Pose", path: "/videos/warrior.mp4" },
  3: { name: "Triangle Pose", path: "/videos/triangle.mp4" },
  4: { name: "Vajrasana", path: "/videos/vajrasan.mp4" },
  5: { name: "Backward Bend", path: "/videos/backwardbend_pose.mp4" },
};

const CsvGraphPlotter = () => {
  const [data, setData] = useState([]); // Parsed CSV data
  const [currentIndex, setCurrentIndex] = useState(0); // Tracks the current starting row
  const [chartData, setChartData] = useState(null); // Graph data
  const [currentActivity, setCurrentActivity] = useState("Unknown Activity"); // Current activity label
  const [videoSrc, setVideoSrc] = useState(""); // Current video source

  // Update video and graph when data changes
  useEffect(() => {
    if (data.length > 0) {
      const interval = setInterval(() => {
        updateChartAndVideo(currentIndex);
        setCurrentIndex((prevIndex) => (prevIndex + 50) % data.length); // Loop through rows
      }, 2000); // Update every 1 second
      return () => clearInterval(interval); // Cleanup interval
    }
  }, [data, currentIndex]);

  // File upload handler
  const handleFileUpload = (event) => {
    const file = event.target.files[0];
    if (file) {
      Papa.parse(file, {
        complete: (result) => {
          const parsedData = result.data.filter((row) => row.length === 53); // Validate rows with exactly 53 columns
          setData(parsedData);
          updateChartAndVideo(0); // Initialize chart and video
        },
        header: false,
        skipEmptyLines: true,
      });
    }
  };

  // Update chart and video for the current chunk of rows
  const updateChartAndVideo = (startIndex) => {
    const endIndex = startIndex + 50 > data.length ? data.length : startIndex + 50;
    const rows = data.slice(startIndex, endIndex); // Get rows for the current chunk
    const xLabels = rows.map((_, idx) => `t ${startIndex + idx + 1}`); // X-axis labels

    // Create datasets for graph
    const datasets = Array.from({ length: 52 }, (_, colIdx) => ({
      label: `Column ${colIdx + 1}`,
      data: rows.map((row) => parseFloat(row[colIdx])),
      borderColor: `rgba(${Math.random() * 255}, ${Math.random() * 255}, ${Math.random() * 255}, 0.6)`,
      borderWidth: 1,
      fill: false,
    }));

    setChartData({
      labels: xLabels,
      datasets,
    });

    // Handle video update
    const firstRow = rows[0];
    if (firstRow && firstRow.length > 52) {
      const label = parseInt(firstRow[52], 10); // Get the label from the last column
      if (videoMapping[label]) {
        setCurrentActivity(videoMapping[label].name);
        setVideoSrc(videoMapping[label].path);
      } else {
        setCurrentActivity("Unknown Activity");
        setVideoSrc("");
      }
    } else {
      setCurrentActivity("Unknown Activity");
      setVideoSrc("");
    }
  };

  return (
    <div style={{ textAlign: "center", padding: "20px" }}>
      <h1>CSV File Graph Plotter</h1>
      <input
        type="file"
        accept=".csv"
        onChange={handleFileUpload}
        style={{ margin: "20px", padding: "10px" }}
      />

      <div style={{ display: "flex", justifyContent: "space-around", padding: "20px" }}>
        {/* Graph Section */}
        <div style={{ width: "45%" }}>
          {chartData ? (
            <Line
              data={chartData}
              options={{
                responsive: true,
                maintainAspectRatio: false,
                scales: {
                  x: { title: { display: true, text: "time." }, grid: { display: true } },
                  y: { title: { display: true, text: "Values" }, grid: { display: true } },
                },
                plugins: {
                  legend: { display: false },
                  tooltip: { mode: "index", intersect: false },
                },
              }}
            />
          ) : (
            <p style={{ color: "#888" }}>Upload a CSV file to display the graph.</p>
          )}
        </div>

        {/* Video Section */}
        <div style={{ width: "45%" }}>
            <h1>Current Activity: {currentActivity}</h1>
            {videoSrc ? (
            <video
            key={videoSrc} // Force React to remount the video element when videoSrc changes
            width="100%"
            height="400"
            loop
            autoPlay
            muted
            controls={false}
            style= {{ objectFit: "contain",
                pointerEvents: "none"

            }}
            >
            <source src={videoSrc} type="video/mp4" />
            Your browser does not support the video tag.
            </video>
        ) : (
            <p>No video available for the current activity.</p>
        )}
        </div>
    </div>
    </div>
  );
};

export default CsvGraphPlotter;
